// src/utils/sampleData.js
const sampleData = [
  { name: 'Bitcoin', symbol: 'BTC', price: 65000 },
  { name: 'Ethereum', symbol: 'ETH', price: 3200 },
  { name: 'Ripple', symbol: 'XRP', price: 1.20 },
];

export default sampleData;
